domain_model.plantuml:
@startuml

class LSF {
  -ambientTemperatureRange: String
  -roofLoad: String
  -operationHours: String
  -pollutionPreventionPolicy: String
  -environmentalEffectsAbroadPolicy: String
  -antarcticTreatyProtocol: String
  -FDACompliance: String
  -OSHARegulations: String
  -internationalBuildingCode: String
  -fireCode: String
  -fuelGasCode: String
  -transportabilityCriteria: String
  -transportability: String
  +contain(equipment: Object): void
  +implement(disposalSystem: DisposalSystem): void
  +include(component: Object): void
  +provide(service: String): void
  +store(item: String, amount: String): void
  +monitor(consumption: String): void
  +notify(occupant: Occupant, failure: String, timeLimit: String): void
  +test(equipment: String, interval: String): void
  +generate(output: String): Object
  +conserveEnergy(): void
  +remind(occupant: Occupant, task: String): void
  +employ(tests: String): void
}

class WaterRecyclingSubsystem {
  -safetyWaterStandards: String
  -pHLevel: String
  -EPAStandards: String
  -WHOStandards: String
  +filterWater(): void
  +displayWaterQuality(displayType: String): void
}

class WaterStorageSubsystem {
  -storesPotableWater: boolean
  -storesBlackWater: boolean
  -storesGrayWater: boolean
  -capacityRequirements: String
  +store(waterType: String): void
}

class DisposalSystem {
  -effectiveUnderExtremeWeather: boolean
  +processWaste(): void
}

class RefrigerationSystem {
  -capacityCubicFeet: double
  +provide(space: String): void
}

class FreezerSystem {
  -capacityCubicFeet: double
  +provide(space: String): void
}

class SensorNetwork {
  +monitorEquipmentHealth(): void
}

class Sensor {
  -connectionType: String
}

class MonitoringDevice {
  -waterQuality: String
  -contaminationLevels: String
  +alertLSF(): void
  +retrieveData(application: Application): void
  +notifyMaintenance(occupant: Occupant, maintenance: String): void
}

class Application {
  +retrieveMonitoringData(device: MonitoringDevice): void
}

class ExpeditionDrillingEquipmentStorage {
}

class IceCoreStorage {
  -capacity: int
  -minTemperatureF: double
  -maxTemperatureF: double
}

class ScientificDataExchange {
  +transmitDataEncrypted(): void
}

class ResearchTeam {
  +establishCloudStorage(): void
  +interfaceWithSystem(system: Object): void
}

class WindowsPC {
}

class EncryptedServer {
  -encryptedStorage: boolean
  +access(files: String): void
  +identify(files: String): void
}

class ControlSystem {
  -passwordProtected: boolean
  -panelsLocked: boolean
  +updateSoftware(): void
  +performBuiltInTest(): void
}

class SmartDevice {
}

class ControlPanel {
  -accessibleFromInside: boolean
}

class Radio {
  -batteryBackup: boolean
  -handCrank: boolean
  -solarPower: boolean
  +communicate(station: String): void
}

class Camera {
  +videoConference(): void
}

class ComputerSystem {
  -count: int
  +supportDataTransmission(): void
}

class Network {
  -minimumDownloadSpeed: String
  -minimumUploadSpeed: String
  -averageWiFiSpeed: String
  +supportSpeed(speed: String): void
}

class PowerGenerationSubsystem {
  -testInterval: String
  +test(): void
}

class Occupant {
}

LSF *-- WaterRecyclingSubsystem
LSF *-- WaterStorageSubsystem
LSF *-- DisposalSystem
LSF *-- RefrigerationSystem
LSF *-- FreezerSystem
LSF *-- SensorNetwork
LSF *-- ExpeditionDrillingEquipmentStorage
LSF *-- IceCoreStorage
LSF *-- ScientificDataExchange
LSF *-- Radio : "1..*"
LSF *-- Camera
LSF *-- ComputerSystem
LSF *-- EncryptedServer
LSF *-- Network
LSF *-- PowerGenerationSubsystem

WaterRecyclingSubsystem *-- MonitoringDevice
WaterStorageSubsystem *-- MonitoringDevice
MonitoringDevice --> Application
MonitoringDevice --> LSF
SensorNetwork o-- Sensor
ScientificDataExchange --> ResearchTeam
ResearchTeam --> WindowsPC
ControlSystem --> SmartDevice
ControlSystem --> ControlPanel

@enduml
